query GetHighlightReel($modelId: ID!) {
  model(id: $modelId) {
    id
    activeHighlightReel {
      ...HighlightReelDetails
      __typename
    }
    __typename
  }
}

fragment HighlightReelDetails on HighlightReel {
  id
  label
  reel {
    overrides {
      transitionType
      panDirection
      panAngle
      __typename
    }
    asset {
      ... on Photo {
        id
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}
